INSERT INTO `article` VALUES (1,6372788526379598082,'vivo X9：再见','未来智能数码','当雷军和众多友商在不断科普“性价比”一词时，vivo却对于这样的玩法很是不屑，其发布会并不会强调跑分，因其产品本身并没有很高的性价比。余承东在华为Mate 9发布会上通过调研而总结出的三大手机痛点“性能、续航和拍照”，vivo X9只抓住了一个点做文章。',0,0,0,0,0,0,'http://toutiao.com/group/6372788526379598082/','http://toutiao.com/group/6372788526379598082/?iid=0&app=news_article',1483781460,1490239325,0,0,'保健品,vivo,余承东,天猫,Mate'),(2,6395015429648204033,'vivo手机相机的10个秘密，总有一个你不知道','数码极客','不管是旅行、美食还是任何地方，拍照少不了~~今天小编告诉大家几招vivo手机最实用的拍照技巧，快快get起来！1.巧用相机连拍功能，拍摄时只要长按拍摄按钮，即快速快速拍N张照片，然后再选一张你最喜欢的照片即可。 2. 利用vivo相机专业拍摄模式进行拍照。',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index?id=1972023&subscribe=5571749564&source_type=6&content_type=1&create_user_id=1402&classify=7&adid=__AID__','http://toutiao.com/group/6395015429648204033/?iid=0&app=news_article',1488956400,1490239325,0,0,'拍照模式,慢镜头,拍照,HDR,钢化膜'),(3,6373428889871450625,'步步高vivo隐藏功能，教你玩转vivo手机','趣玩潮事','在国产手机中，步步高vivo一直深受年轻群体的欢迎，不仅因为其优惠的价格，简洁大方的外观，更是因为其功能齐全。vivo手机是vivo和追求乐趣、充满活力、年轻时尚的群体一起打造拥有卓越外观、专业级音质、愉悦体验的智能产品，并且在市场上的销量也节节攀升的状况。',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index/?id=10112537&source_type=12&content_type=1','http://toutiao.com/group/6373428889871450625/?iid=0&app=news_article',1483929540,1490239325,0,0,'智能手机,步步高vivo,vivo智能,手机屏幕,国产手机'),(4,6393179020422283777,'vivo手机电池不耐用？只是你还没开启这些功能','TV全网通','随着技术的提升和手机厂商对自家产品的优化，体验已经完全能够满足用户使用，大家关注更多的反而是外观设计和电池续航。而电池续航，一直都是电子数码产品的痛点，为此各个品牌做出了很多针对这方面的优化。尤其是系统层面的优化，加入了许多可以提升大家手机续航的设置，但这些功能却经常被大家忽略。',0,0,0,0,0,0,'http://toutiao.com/group/6393179020422283777/','http://toutiao.com/group/6393179020422283777/?iid=0&app=news_article',1488527940,1490239325,0,0,'vivo X9,APP,vivo手机,关联启动,后台高耗电'),(5,6398782497974387202,'vivo手机使用来电闪光灯功能，这个开关一定要打开','科技曼曼谈','欢迎关注微信订阅号：科技曼曼谈。',0,0,0,0,0,0,'http://toutiao.com/group/6398782497974387202/','http://toutiao.com/group/6398782497974387202/?iid=0&app=news_article',1489832640,1490239325,0,0,''),(6,6374387156609941762,'vivo X7是一代神话，那么vivo X9呢？','数码极客','vivo X7是vivo在今年7月份发布的一款手机，这是自2012年发布vivo X1至今，X系列的第7款产品，是vivo在中高端市场出货的主力，也是把vivo顶上巅峰的一款手机，不过vivo X9也出了，它是否能代替vivo X7呢？',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index?id=1624869&subscribe=5571749564&source_type=6&content_type=1&create_user_id=333&classify=7','http://toutiao.com/group/6374387156609941762/?iid=0&app=news_article',1484154180,1490239325,0,0,'AK4376,vivo X9,手机壳,拍照能力,vivo X7'),(7,6398649734126371073,'不用vivo手机隐藏的3个功能，怪可惜的！','叽歪数码','手机这种东西，其实在使用一段时间之后，我们都会发现电池越来越不耐用了从原本的一天一充，慢慢的变成两天一充，再变成一天两充，你可体验过这样的心情？不过如果你使用的是vivo手机，叽歪数码有几个小技巧，赶紧来试试。',0,0,0,0,0,0,'http://toutiao.com/group/6398649734126371073/','http://toutiao.com/group/6398649734126371073/?iid=0&app=news_article',1489801680,1490239325,0,0,'操作步骤,网络权限,数码,vivo手机'),(8,6396512952087019777,'两个设置就能让vivo手机流畅到爆，网友：你不说还真不知道！','对讲机世界','刚刚过去的2016年，vivo在手机市场上以璀璨夺目的销售表现为这一年划上了圆满的句号。但是有不少vivo手机手机用户都有这样感觉，新买的手机用一段时间后就开始出现卡顿现象了。打开应用反应时间越来越慢了。下面两个技巧让你的vivo手机流畅到爆。',0,0,0,0,0,0,'','http://toutiao.com/group/6396512952087019777/?iid=0&app=news_article',1489305480,1490239325,0,0,'手机市场,vivo手机,华为手机,VIVO,vivo'),(9,6399968619561206017,'你的vivo手机有这么好用的功能，你还不知道？','哇科技','vivo 跟随vivoX9一起发布的Funtouch OS 3.0，给人的感觉就是界面流畅小清新并采用扁平化设计，很是不错。之前也有给大家分享像分屏操作啊，应用分身等功能vivo手机最好用的功能有哪些？今天来讲讲几个实用的小功能，相信你能用到的。省电模式省电模式特别贴心。',0,0,0,0,0,0,'http://toutiao.com/group/6399968619561206017/','http://toutiao.com/group/6399968619561206017/?iid=0&app=news_article',1490110200,1490239325,0,0,'省电模式,vivo手机,隐私,vivo'),(10,6395077382077202690,'vivo X9和vivo X9Plus你会购买哪部？','科技V力','',0,0,0,0,0,0,'http://toutiao.com/group/6395077382077202690/','http://toutiao.com/group/6395077382077202690/?iid=0&app=news_article',1488971160,1490239325,0,0,'vivo X9,三八节,COS,背景虚化,X9 Plus'),(11,6398036936943501570,'vivo手机越来越卡，续航差，完成这两个设置运行提升2倍','数码极客','vivo手机用久了会变得卡顿，这也是vivo的通病，再加上安卓的软件环境相对比较复杂，有很多全家桶式的流氓软件，在后台偷偷的运行，当你打开手机的那一刻，它们就已经在运行了，所以，当你觉得手机运存比较吃力的时候，不妨试一试完成下面这两项设置。',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index?id=2048362&subscribe=5571749564&source_type=6&content_type=1&create_user_id=1543&classify=7&adid=__AID__','http://toutiao.com/group/6398036936943501570/?iid=0&app=news_article',1489659840,1490239325,0,0,'流氓软件,手机壳,vivo手机,自动启动管理,i管家'),(12,6391768202343448834,'vivo手机这个不起眼按键用处居然这么大，让苹果用户羡慕不已','数码极客','作为一个天天使用微信的人，甚至出门付钱都是用微信支付。不过每次支付的时候都要通过进入【微信-钱包-付款】这一系列十分漫长而繁琐的步骤才能完成支付（本人是iPhone用户），真的超级烦！！！用久了之后越发觉得很不方便。',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index?id=1888940&subscribe=5571749564&source_type=6&content_type=1&create_user_id=1402&classify=7&adid=__AID__','http://toutiao.com/group/6391768202343448834/?iid=0&app=news_article',1488200400,1490239325,0,0,'手机壳,快捷启动,vivo手机,双击Home键,支付宝'),(13,6377571670576152834,'拆vivo x6 完全拆掉','鼎盛达人','vivo一代旗舰机，手机用起来体验不错。屏幕坏了。进点水，今天就把他给彻底给拆报废。手机正面手机背面。粉色的。拆掉底部两颗五角星螺丝。用翘片从底部开始，翘起来。这个机器很好拆。拆开的后盖，清楚的看到指纹识别模块后面的样子。外壳做工绝对是A货。三段式设计，马上开始拆主板。',0,0,0,0,0,0,'http://toutiao.com/group/6377571670576152834/','http://toutiao.com/group/6377571670576152834/?iid=0&app=news_article',1484894940,1490239325,0,0,'vivo'),(14,6398442483886702849,'只需两个设置就能让vivo手机流畅如水，网友看了后都说好！','数码天地','在《天翼终端满意度调研报告与终端质量报告》中，在类似品牌忠诚度的统计中，vivo用户中上一个手机品牌是苹果的占15%，是三星的占21%，是小米的占13%，来自vivo用户的占19%。在vivo用户中，下一个品牌继续使用vivo产品的占到了43%，苹果7%，而华为占4%。',0,0,0,0,0,0,'','http://toutiao.com/group/6398442483886702849/?iid=0&app=news_article',1489754400,1490239325,0,0,'智能手机,vivo用户,VIVO手机,品牌忠诚度,开发者选项'),(15,6399985367247913217,'VIVO手机开启这几个功能，让音质提升太多，真心赞！','简单的发呆','vivo为一个专注于智能手机领域的手机品牌，vivo和追求乐趣、充满活力、年轻时尚的城市群体一起打造拥有卓越外观、专业级音质、极致影像、愉悦体验的智能产品，并将敢于追求极致、持续创造惊喜作为vivo的坚定追求。',0,0,0,0,0,0,'','http://toutiao.com/group/6399985367247913217/?iid=0&app=news_article',1490114220,1490239325,0,0,'X7Plus,Hi-Fi,手机壳,QQ音乐,手机膜'),(16,6399959364363813121,'VIVO手机的这四个最实用功能，不用就真的太浪费了！','简单的发呆','2016年绝对是线下手机渠道的丰收年，曾经火热的互联网模式似乎不再吃香，典型代表就是OPPO、vivo的强势崛起，甚至华为都感受到了空前的压力，而且这种状况还在继续甚至加强。',0,0,0,0,0,0,'','http://toutiao.com/group/6399959364363813121/?iid=0&app=news_article',1490107800,1490239325,0,0,'相机功能,VIVO手机,手机自带,OPPO,钢化膜'),(17,6400234160304636161,'全曲屏旗舰全新配色，vivo Xplay6磨砂黑上市','想和世界聊聊','xplay6搭载骁龙820处理器，6GBLPDDR4运行内存，配128GB