.com/group/6398002655557484801/?iid=0&app=news_article',1489651740,1490239326,0,0,'云服务,X11,单手操作,拿出口袋亮屏,手机屏幕'),(81,6395804533549269249,'关闭这几个功能后，让你的vivo手机电量更耐用，速度更快！','智慧洞察','MWC2017全球移动技术大会在巴塞罗那的正式开幕，众多手机厂商都在MWC2017里面展示自己最新的技术以及爆款机型。在今年MWC上国内大牌手机厂商也登上舞台，绽放自己的精彩，作为去年出货量全球第五的vivo手机2016年销售量暴增99%，今年MWC大会上同样拥有出彩的表现。',0,0,0,0,0,0,'','http://toutiao.com/group/6395804533549269249/?iid=0&app=news_article',1489140120,1490239326,0,0,'设置方法,MWC,Xplay6,WLAN,MWC2017'),(82,6384325426265260290,'四曲面屏vivo Xplay6 拆解','十万个黑科技','今天，小编给大家带来的是四曲面屏vivo Xplay6的拆解过程 ，由于该机内部结构复杂，希望普通用户不要进行尝试。',0,0,0,0,0,0,'http://toutiao.com/group/6384325426265260290/','http://toutiao.com/group/6384325426265260290/?iid=0&app=news_article',1486467360,1490239326,0,0,'屏蔽罩,排线,导热硅脂,Xplay6,同轴电缆'),(83,6389419567189590274,'这些vivo手机壳，让你钟意的vivo颜值飙升','数码极客','',0,0,0,0,0,0,'https://temai.snssdk.com/article/feed/index?id=1837982&subscribe=5571749564&source_type=6&content_type=2&create_user_id=3749&classify=7&adid=__AID__','http://toutiao.com/group/6389419567189590274/?iid=0&app=news_article',1487653200,1490239326,0,0,'vivo v3,手机壳,步步高,浮雕,vivo x6'),(84,6386442591163908609,'vivo V5Plus爆料对比vivo Y66','物客','vivo V5Plus爆料对比vivo Y66',0,0,0,0,0,0,'http://toutiao.com/group/6386442591163908609/','http://toutiao.com/group/6386442591163908609/?iid=0&app=news_article',1486959540,1490239326,0,0,'vivo'),(85,6376395217675763969,'vivo硬件“编年史”','接近真理玩数码','据外媒报道，16年第三季度，中国再次蝉联世界最大智能手机市场宝座，同时各大厂商的排名也出现了剧烈的变动。市场研究机构Counterpoint Research的数据显示，第三季度vivo全面超越手机界的龙头老大华为，不仅如此，vivo市场占有率从15年同期的8.',0,0,0,0,0,0,'http://toutiao.com/group/6376395217675763969/','http://toutiao.com/group/6376395217675763969/?iid=0&app=news_article',1484621160,1490239326,0,0,'友达光电,供应链,供应商,双曲面,忠诚度'),(86,6397837829359272194,'128G版vivo x9只要这个价格！vivo良心厂商啊！','城绘数码','作为ViVO现在的主打机型，vivo X9的配置在两千元价位的智能手机中也还算可以。5.5寸1080p显示屏，搭载骁龙625处理器和4GB内存（64/128GB存储）。对于普通用户日常使用是完全足够了。同时凭借其主打的柔光自拍在市场上也取得了不错的销售额。',0,0,0,0,0,0,'http://toutiao.com/group/6397837829359272194/','http://toutiao.com/group/6397