？',0,0,0,0,0,0,'http://toutiao.com/group/6400168996490100993/','http://toutiao.com/group/6400168996490100993/?iid=0&app=news_article',1490156340,1490239467,0,0,'OpenGL,apple watch,GameBoy,Apple Watch,苹果'),(274,6400247922526028033,'苹果支付在中国好惨：用户三个月才付一次','官院巷','当Apple Pay去年2月在中国亮相时，它找来了十几家合作伙伴，其中包括中国工商银行和建设银行。更重要的是，用户可在Apple Pay登记他们的银行或信用卡，然后在中国银联无处不在的销售点网络进行购物，该网络包含超过1000万台支持触控支付的机器。中国银联发言人拒绝置评。',0,0,0,0,0,0,'http://toutiao.com/group/6400247922526028033/','http://toutiao.com/group/6400247922526028033/?iid=0&app=news_article',1490174580,1490239467,0,0,'中国工商银行,建设银行,Apple Pay,支付宝,apple pay'),(275,6399968474114556161,'保持简洁、引起用户共鸣，好的设计不只是Apple独有','稀饭玩数码','产品是供人使用的，它应履行一定的功能——主要功能以及额外的心理和审美上的功能。好的设计是为了提升产品可用性，与此目的无关甚至相悖的一切都不应加以考虑。这是德国著名工业设计师Dieter Rams的设计理念。',0,0,0,0,0,0,'http://toutiao.com/group/6399968474114556161/','http://toutiao.com/group/6399968474114556161/?iid=0&app=news_article',1490110140,1490239467,0,0,'Flyme 6,iPod,Rams,设计风格,iPhone'),(276,6399838343627440385,'一个视力很好的开发者，在Apple Watch上玩《精灵宝可梦》','超能网','任天堂、Pokemon和Niantic Labs在去年联手推出AR手游《精灵宝可梦GO》，掀起过一阵通街抓宝可梦的热潮，但有个开发者宝可梦玩家并不喜欢这么近未来的游戏方式，他更想玩原来GameBoy版的《精灵宝可梦》，而且他选择的设备也很特别：在Apple Watch智能手表上。',0,0,0,0,0,0,'http://www.expreview.com/53100.html','http://toutiao.com/group/6399838343627440385/?iid=0&app=news_article',1490079360,1490239467,0,0,'Metal,WWDC,GameBoy,精灵宝可梦黄,Apple Watch,watchOS,精灵宝可梦GO'),(277,6400202507109482753,'苹果红也叫“艾滋红” 背后还有许多你不知道的事','侃科技','当朋友圈被“苹果红”刷屏时，库克正忙着在中国四处奔波，参加会议、造访创业公司。没有传闻中的春季发布会，几个小时的官网维护后苹果悄然发布了全新的红色版iPhone 7、iPhone 7 Plus，128GB容量起步6188元起售。',0,0,0,0,0,0,'http://toutiao.com/group/6400202507109482753/','http://toutiao.com/group/6400202507109482753/?iid=0&app=news_article',1490164980,1490239468,0,0,'iPhone 7,iPod,苹果红,Beats,OPPO'),(278,6400198272765821186,'硬件之外，苹果还推出了好玩的视频应用Clips','数码窝','各位肯定已经被各种苹果新品硬件刷屏，iPad槽点满满，红色iPhone 7系列着实漂亮，各种Apple Watch表带眼花缭乱...而实际上苹果昨天还推出了一款非常有意思的视频应用，名为Clips。',0,0,0,0,0,0,'http://www.digi-wo.com/6691.shtml','http://toutiao.com/group/6400198272765821186/?iid=0&app=news_art