0,'http://toutiao.com/group/6376046813263085825/','http://toutiao.com/group/6376046813263085825/?iid=0&app=news_article',1484539920,1490239469,0,0,'iPad,Apple Pencil,新一代Apple Pencil,iPad Pro,苹果'),(378,6377342790069829889,'Apple Store零售店为什么这么成功（下篇）','乔伊','当你释放自己的想象力的时候，所有美好的事情都会发生每个人出生时就具备了一项最不可思议的天赋，然而我们并没有意识到，那就是想象力。我们天生就 富有创意，我们都可以成为有创意的人，给我们的生活带来有创意的影响。真正让你在人生中做出意义深远的事情，是你的想象力。',0,0,0,0,0,0,'http://toutiao.com/group/6377342790069829889/','http://toutiao.com/group/6377342790069829889/?iid=0&app=news_article',1484842380,1490239469,0,0,'零售店,史蒂夫,Target,罗恩,苹果零售店'),(379,6219144239574417921,'Apple Pencil 只能拆不能修','映象网','主角已被拆了，配角也不能不拆吧？iFixit 已完成 Apple Pencil 的拆解，最终判定它的易修度极底，10 分里只取得 1 分。他们指出虽然 Pencil 的笔尖是可由用户自行扭出更换，苹果更附送一个做后备，，但是整枝笔就只有这部份是易于更换而已。',0,0,0,0,0,0,'https://m.hnr.cn/article/tech/20170131_d40743_0.html','http://toutiao.com/group/6219144239574417921/?iid=0&app=news_article',1485850260,1490239469,0,0,'Pencil,Lightning,苹果,iFixit'),(380,6379011647676547330,'骚男的PPAP apple pen~','我想摸你的头发','骚男的PPAP apple pen~',0,0,0,0,0,0,'http://toutiao.com/group/6379011647676547330/','http://toutiao.com/group/6379011647676547330/?iid=0&app=news_article',1485230160,1490239469,0,0,''),(381,6381407757496746241,'拜仁慕尼黑和Apple Music开启独家合作','新华网','拜仁慕尼黑和Apple Music开启独家合作，并且在2017年和Beats by Dr. Dre继续携手！从今天开始，音乐迷和拜仁慕尼黑的支持者可以通过Apple Music提供的独家播放列表和内容，更近距离了解喜欢的球队以及德国足坛“纪录冠军”的众多球星。',0,0,0,0,0,0,'http://news.xinhuanet.com/sports/2017-01/31/c_1120396760.htm','http://toutiao.com/group/6381407757496746241/?iid=0&app=news_article',1485855840,1490239469,0,0,'Beats,拜仁慕尼黑,Dr. Dre,Apple Music,播放列表'),(382,6377137377928478977,'支付宝的红包支持购买Apple Store和Apple music','映象网','新浪手机 1月19日讯，近日在这两天，相信你的朋友圈再一次被各种“福”吞没。不过这去年不同的是，这次支付宝加入了AR扫福字功能，还可以扫出现金大奖。新浪手机也试了试这项功能，意外得到了一个“花呗红包”内含3元礼券，可用于Apple Store和Apple Music支付。',0,0,0,0,0,0,'https://m.hnr.cn/article/tech/20170119_663637_0.html','http://toutiao.com/group/6377137377928478977/?iid=0&app=news_article',1484795880,1490239469,0,0,'Apple Store,支付宝,Apple Music,Apple,花呗'),(3