iid=0&app=news_article',1483578300,1490239469,0,0,'支付宝,apple pay,Apple Pay,电子商务,NFC'),(389,6375272983891919105,'苹果Apple Pencil专利：磁力吸附设计','TechWeb','【TechWeb报道】提起苹果Apple Pencil，和微软Surface系列的手写笔最大的区别就是不像一支笔，虽然用起来很舒服但携带不够方便，没有收纳机制，这也是不如Surfac系列产品手写笔的地方。',0,0,0,0,0,0,'http://m.techweb.com.cn/toutiao/2017-01-14/2473268.shtml','http://toutiao.com/group/6375272983891919105/?iid=0&app=news_article',1484360100,1490239469,0,0,'iPad Pro,Surface,手写笔,iPad,Pencil'),(390,6379605433086116098,'为什么Apple TV不是电视而是机顶盒？','头条问答','以苹果的研发能力，研发一个电视轻轻松松，盈利空间也比做机顶盒大，但它们为什么只做了机顶盒？并且在美国，机顶盒市场竞争很激烈。',0,0,0,0,0,0,'http://toutiao.com/item/6379605433086116098/','http://toutiao.com/group/6379605433086116098/?iid=0&app=news_article',1485370920,1490239469,0,0,'机顶盒,apple tv,苹果'),(391,6398835473153818881,'3月21日小米春季新品发布会，多款新品将亮相','雷阵雨科技范','今天有网友爆出，小米电视2017春季新品发布会将会在3月21日召开。发布会的代号为‘A计划’，主题是‘小小的梦想，大大的突破’。',0,0,0,1,0,0,'http://toutiao.com/group/6398835473153818881/','http://toutiao.com/group/6398835473153818881/?iid=0&app=news_article',1489846320,1490239489,0,0,'刀锋战士,A计划,小米平板,发布会,小米6'),(392,6399845705552232961,'小米6确定双曲面+双摄，骁龙835+6G大运存配置豪华！','科技蟹','小米5已经发布一年多时间，但它的换代机型小米6却迟迟没有消息，虽然16年小米推出了小幅升级版的小米5s,但是外观确实...不过，米粉们期待了一年多的小米6即将发布，预计会在4月末与大家见面。近日，一张疑似小米6的配置截图也流了出来，图片显示该机搭载最高主频为2.',0,0,0,1,0,0,'http://toutiao.com/group/6399845705552232961/','http://toutiao.com/group/6399845705552232961/?iid=0&app=news_article',1490080140,1490239489,0,0,'MIUI,Android,双曲面,小米Note,小米6'),(393,6399887340328452353,'漂亮！小米6 4款新配色齐曝光！','数码闲聊站','3月21日讯，某论坛网友曝光了小米科技即将发布的小米6 4款新配色以及真机渲染图:据渲染图，小米手机6拥有白、蓝、黑、金共4款新配色，手机背部采用3D陶瓷材质，陶瓷温润的质感加上优秀的弧度，真机手感一定很出色。',0,0,0,1,0,0,'http://toutiao.com/group/6399887340328452353/','http://toutiao.com/group/6399887340328452353/?iid=0&app=news_article',1490090700,1490239489,0,0,'小米,小米手机,小米科技,Plus,数码'),(394,6399769221307351298,'小米内部员工曝光小米6渲染图！','希数码','近日，小米内部员工@渠洋 曝光了小米6渲染图。据悉，小米6采用双摄像头设计，3D陶瓷背板，前置指纹识别，搭载高通骁龙835处理器，4g运存起步。但这与爆料人曝光的小米6有很大出入，也有网友猜想，这是故意放的假图，给大家一个惊喜。',0,0,0,1,0,0,'http://toutiao.com/group/6399769221307351298/','http://toutiao.com/group/6399769221307351298/?iid=0&app=news_article',1490063040,1490239489,0,0,''),(395,6381829021361471745,'小米官方曝光：小米17年十大新品','璞科技','作为一个闲逛淘宝的小编，却让我意外发现小米手机官方旗舰店在淘宝的微淘发布了一张小米17年TOP10新品！这个不多说，看图！ 据了解这些图疑似由第三方绘制！但是由小米官方旗舰店再次曝光，难道要证实这些新品的存在吗？',0,0,0,1,0,0,'http://toutiao.com/group/6381829021361471745/','http://toutiao.com/group/6381829021361471745/?iid=0&app=news_article',1486702020,1490239489,0,0,'旗舰店,小米,小米手机'),(396,6399961539512811777,'小米手机6发布时间有变！预计会在米粉节前正式发布','石头搞机','高通骁龙835是今年的旗舰芯片，虽然小米没能抢过三星拿到首发，但作为高性价比的骁龙835手机，小米6依然是今年最受期待的旗舰手机，毕竟只需不到三星S8一半的钱就能享受同等性能，所以何时发布就成为了很多米粉期待的事情！↑ 据此前的消息，小米6将于4月11日正式发布！',0,0,0,1,0,0,'http://toutiao.com/group/6399961539512811777/','http://toutiao.com/group/6399961539512811777/?iid=0&app=news_article',1490108400,1490239489,0,0,'三星,小米6,骁龙835,小米,小米手机'),(397,6399872364816990465,'直播-小米3月21日新品发布会！除了电视还有什么？','JJ科技','每年的3月份，都是各大手机厂商乃至科技公司发布新品的高峰期，2016年的小米手机销量虽然不如前，但是产品品质和手机外的其他领域的开拓，小米布的局是给你一个未来智能的家。',0,0,0,1,0,0,'http://toutiao.com/group/6399872364816990465/','http://toutiao.com/group/6399872364816990465/?iid=0&app=news_article',1490087040,1490239489,0,0,'小米电视4A,小米电视,电力猫,小米手机,净水器'),(398,6399861975819796738,'小米又出新品！4种尺寸+4核64位旗舰处理器+32GB+杜比','IT168网','今天下午，小米在北京召开了新品发布会，发布最新款的旗舰电视——小米电视4A，该电视曾在今年的CES上展出过，其采用分体式设计，超薄的机身，厚度比iPhone 7还要薄，因此受到了不少外媒的关注和好评。',0,0,0,1,0,0,'http://toutiao.com/group/6399861975819796738/','http://toutiao.com/group/6399861975819796738/?iid=0&app=news_article',1490084820,1490239489,0,0,'小米电视4A,人工智能,CES,HDR,Amlogic'),(399,6399848225804747009,'小米电视4A发布：2099元起，又一款高性价比电视','太平洋电脑网','北京时间3月21日下午2点，小米电视在北京泰富酒店如期召开了小米电视春节新品发布会，从发布会前的官方宣传海报上来看的话，最新的小米电视应该是在高性能、系统简单易用、以及更加智能化的方向有所突破，而发布会开始后则证实了这个猜测。',0,0,0,1,0,0,'http://toutiao.com/group/6399848225804747009/','http://toutiao.com/group/6399848225804747009/?iid=0&app=news_article',1490081580,1490239489,0,0,''),(400,6400138816065700097,'小米6仿真图，小米KOL证实','SmartTechnology','此前多次暗示小米6信息的KOL@KK低调、@熊本科技最近又将小米6还原得接近真机不能发真机图片，所以网友@vern_eva制作了模拟图小米6可能取消耳机孔加入防水功能和无线充电，前面板