568514,'小米手机 4S拆解','洋仔评测','',0,0,0,1,0,0,'http://toutiao.com/group/6373091011849568514/','http://toutiao.com/group/6373091011849568514/?iid=0&app=news_article',1483851780,1490239489,0,0,'小米手机'),(420,6400177133566591234,'小米电视出师不利，出门问问怒怼小米','桃子茶馆','昨天小米的电视刚刚发表，今天出门问问就在各个官方渠道怒怼小米，申明小米在合约未谈好的情况下，就直接在发布会使用对方的产品。具体申明如下：接着，让我们来看看网友们的评论：可以看到，网友几乎都是一面倒的支持出门问问，对小米表达了不满。我作为小米首批15W用户，想借这个机会，和雷军说。',0,0,0,1,0,0,'http://toutiao.com/group/6400177133566591234/','http://toutiao.com/group/6400177133566591234/?iid=0&app=news_article',1490158320,1490239489,0,0,'雷军,小米,小米4,出门问问,小米电视'),(421,6400244212033569026,'小米、魅族手机由同一厂家生产，为什么还互相杀价？','数码大时代','智能手机现在基本实现了普及，几乎人手一部。手机销量也越来越高，16年全年生产手机21亿部，其中智能手机15亿部.这么大的量都是由国内的这些手机厂商生产出来的。但是并不代表所有的手机都需要自己生产。很多的手机都是由代工企业生产，这种情况不只是现在有，在功能机时代就有。',0,0,0,1,0,0,'http://toutiao.com/group/6400244212033569026/','http://toutiao.com/group/6400244212033569026/?iid=0&app=news_article',1490173680,1490239489,0,0,'HTC,ODM厂商,智能手机,魅族,笔记本电脑'),(422,6400263317404139778,'小米实在太强大了，没想到还推出了这款“智能对讲机”！','竖锯评测','',0,0,0,1,0,0,'http://toutiao.com/group/6400263317404139778/','http://toutiao.com/group/6400263317404139778/?iid=0&app=news_article',1490178300,1490239489,0,0,'对讲机,小米,小米米家智能对讲机,米家智能对讲机,小米米家智能'),(423,6380394289281351938,'小米手机……','hu2464','从小米手机一代的发布，主打“为发烧而生”，1999元高配低价。当时抢购潮还不那么盛行，品牌也不那么响亮，身边用的人很少。紧接着发布了小米2/2s，2s在民众中就比较普遍了。当时还一起发布了红米系列，抢购潮也开始流行。',0,0,0,1,0,0,'http://toutiao.com/group/6380394289281351938/','http://toutiao.com/group/6380394289281351938/?iid=0&app=news_article',1485553500,1490239489,0,0,'阉割版,发布,note2,mi5,小米手机4'),(424,6393551801258443009,'拆解新款小米对讲机！','创意科技秀','小米对讲机拆解，给大家看看',0,0,0,1,0,0,'http://toutiao.com/group/6393551801258443009/','http://toutiao.com/group/6393551801258443009/?iid=0&app=news_article',1488616140,1490239489,0,0,'对讲机,小米'),(425,6399737390236172546,'小米第一款曲面屏手机：小米Note2','空空也空空','2016年10月25日，小米科技在北京召开发布会，正式发布旗下旗舰定位手机小米Note2。虽然发布了将近半年的时间，但现在的购买热度也没有减少，我们来看看这部手机具体如何。配置参数：外观：小米Note 2采用LG柔性OLED面板，5.',0,0,0,1,0,0,'http://toutiao.com/group/6399737390236172546/','http://toutiao.com/group/6399737390236172546/?iid=0&app=news_article',1490056260,1490239489,0,0,'MIUI,小米Note 2,分辨率,C接口,Pentile'),(426,6394585356323553538,'小米6重磅来袭：吃瓜群众表示很期待','一览科技','3月7日消息，据悉，小米6作为小米旗下最新旗舰，一直是大众关注的焦点。近来小米6消息频出，现在网上流传着一则有关小米6的重磅消息。',0,0,0,1,0,0,'http://toutiao.com/group/6394585356323553538/','http://toutiao.com/group/6394585356323553538/?iid=0&app=news_article',1488952560,1490239489,0,0,'小米6,SoC,骁龙835,A73,联发科'),(427,6389264184379375873,'小米mix值不值得买？','星空数码评测','小米mix已经发布便吸引众人关注，由于陶瓷机身良品率不足，购买小米mix相当不容易，想3499或者3999原价购买就更难了。我看了一下，小米mix尊享版在闲鱼上未拆封的小米mix便需要5000多元，二手的也在4500尊享左右，到底值不值得购买呢，下面先来看一组美图。',0,0,0,1,0,0,'http://toutiao.com/group/6389264184379375873/','http://toutiao.com/group/6389264184379375873/?iid=0&app=news_article',1487617380,1490239489,0,0,'陶瓷机身,小米mix,小米,良品率,摄像头'),(428,6372072244922859778,'小米的：自救产品','科技迷时代','小米手机之于我国本乡科技数码业界，有如苹果在美国的位置。回想小米手机发布之前，处处受制且暮气沉沉的我国数码圈，就知道小米带来的互联网推广形式有多么及时，如果说之前小米改变了本乡品牌的思想形式，那么如今“一面科技，一面艺术”的小米Note2与小米MIX更是充满了”救市“的滋味。',0,0,0,1,0,0,'http://toutiao.com/group/6372072244922859778/','http://toutiao.com/group/6372072244922859778/?iid=0&app=news_article',1483614540,1490239489,0,0,'MIX,小米Note2,指路明灯,小米手机,小米'),(429,6400259617846280450,'小米4A人工智能电视发布，配置强大性价比高，关键是有现货吗？','快评科技','今天下午，小米在北京发布了小米4A人工智能电视，尺寸有43寸、49寸、55寸、65寸，主打的Slogan是“好电视，真听话”。',0,0,0,1,0,0,'http://toutiao.com/group/6400259617846280450/','http://toutiao.com/group/6400259617846280450/?iid=0&app=news_article',1490177400,1490239489,0,0,'人工智能,标准版,小米电视,小米手机,Amlogic'),(430,6372768448325976322,'小米Note2：再见了','科技迷时代','小米手机在发布小米Note2和小米MIX之后，全部品牌的画风为之一转，以往咱们只知道小米性价比无双，但是这一次“一面科技，一面艺术”却玩的愈加精彩！但友商们却没有让小米一家独美，不论是华为Mate9系列，仍是魅族PRO 6 Plus可满是不好惹的狠人物！',0,0,0,1,0,0,'http://toutiao.com/group/6372768448325976322/','http://toutiao.com/group/6372768448325976322/?iid=0&app=news_article',1483776840,1490239489,0,0,'华为Mate9,IMX318,小米Note2,双曲面,魅族'),(431,6400265344161775874,'往年旗舰大拆解之小米note2！','乔希说科技','',0,0,0,1,0,0,'http://toutiao.com/group/6400265344161775874/','http://toutiao.com/group/6