n=8d54bee30a2a24af1a8567c7d43e8d3e','http://toutiao.com/group/6402724312403230977/?iid=0&app=news_article',1490751120,1490771667,0,0,'云服务,智能手机,华为,华为手机,苏杰'),(622,6402775999092687105,'看看NBA库里代言的xplay6是什么颜值？','极客张乐','本文图片整理来自百度贴吧vivo吧爱上果缤纷，如有侵权，本人将在24小时内删除。vivo Xplay6是vivo于2016年11月16日发布的一款智能手机。',0,0,0,6,0,0,'http://toutiao.com/group/6402775999092687105/','http://toutiao.com/group/6402775999092687105/?iid=0&app=news_article',1490763300,1490771667,0,0,'骁龙820,分辨率,果缤纷,vivo Xplay6,ie80'),(623,6402466394138951937,'vivo X9这下急了，同是美光双摄，努比亚M2闪充完胜','玄霄科技','手机目前功能丰富，但限于电池技术问题，很多手机仅仅能够支持一天使用甚至不到，除了续航优化外很多厂商还搭配了快充技术，这样也能有效解决续航短的问题，而市面搭载快充的机型非常多，究竟哪款在实际表现上更好呢，今天我们选择了中端价位配置类似的两部热门机型努比亚M2和vivo X9，看一下',0,0,0,6,0,0,'http://toutiao.com/group/6402466394138951937/','http://toutiao.com/group/6402466394138951937/?iid=0&app=news_article',1490691120,1490771667,0,0,'闪充技术,vivo X9,努比亚M2,NeoPower,AMOLED'),(624,6390862718178640130,'柔光+大屏，vivo X9Plus的2017霸屏之旅','腾讯山东站','在当前智能手机市场中，国产手机中为代表的大部分国货品牌中，要么主推暴强硬件，拥有极致性价比，要么力求弱化硬件，从渠道和明星代言人渗透。但值得肯定的是，无论是主推什么，每一款手机都有其独特的魅力与品质。',0,0,0,6,0,0,'http://toutiao.com/group/6390862718178640130/','http://toutiao.com/group/6390862718178640130/?iid=0&app=news_article',1487989440,1490771667,0,0,'HiFi,home键,雷克萨斯,智能手机,Plus'),(625,6399873776985866497,'iPhone7 Plus偶遇vivo X9，会发生什么事呢？','太湖科技','苹果和vivo最近这两个品牌总是发生交集，因为他们之间真的很像吗？近日就有网友拍了一组苹果7Plus黑色与vivo X9黑色的对比图，我们一起来欣赏一下：都是磨砂黑，背部设计语言也类同。就是摄像头部位的凸起都差不多，关键是一个是单摄一个是双摄。',0,0,0,6,0,0,'http://toutiao.com/group/6399873776985866497/','http://toutiao.com/group/6399873776985866497/?iid=0&app=news_article',1490087400,1490771667,0,0,'摄像头,iphone7,苹果,vivo'),(626,6402556028857499905,'华为、oppo、vivo那个性价比更高？','搞机达人汇','说到性价比，估计大部分人都会自然联想到了价格和性能，当然并不仅仅只是性能这方面还有系统，颜值，拍照和创新等融合，这才是目前智能手机性价比的正确算法，华为，OPPO和vivo是目前国产三大热门手机，可以说是各有特色，至于谁性价比高，只能综合来看了。',0,0,0,6,0,0,'http://toutiao.com/group/6402556028857499905/','http://toutiao.com/group/6402556028857499905/?iid=0&app=news_article',1490712120,1490771667,0,0,'麒麟960,OPPO,运行内存,性价比,华为'),(627,6395079871504564481,'vivo X9系统又升级了，不仅上网更快，还防熊孩子','数码科技指南','提到vivo X9许多人都非常的熟悉，该机由于搭载了2000万像素+800万像素的前置双摄组合，成为了目前手机市场中自拍实力最为强悍的手机产品。其实该机除了拍照有特色之外，在系统方面同样有很多特色之处，就在今天vivo X9的系统再次迎来了大升级，用户体验也得到了更进一步的提升。',0,0,0,6,0,0,'http://toutiao.com/group/6395079871504564481/','http://toutiao.com/group/6395079871504564481/?iid=0&app=news_article',1488971760,1490771667,0,0,'HiFi,兼容性,熊孩子,vivo X9,版本号'),(628,6395892043616387329,'你知道么，开启VIVO的这个功能，让你的手机充电速度杠杠的！','简单的发呆','依靠着深耕多年的线下市场，OPPO和vivo这两年到了收获的季节。北京市场调研机构赛诺给出的数据显示，2017年1月份，OPPO、vivo在中国持续强势，国内出货量分别为835万部、728万部，分别占据了17.1%和14.9%的市场份额。苹果以521万部、10.',0,0,0,6,0,0,'','http://toutiao.com/group/6395892043616387329/?iid=0&app=news_article',1489161240,1490771667,0,0,'华为,vivo手机,vivo,oppo,OPPO'),(629,6402770792984461570,'手机升级好处是什么？比如让双摄有了8倍变焦效果','数码折腾爱好者','Xplay6作为vivo首款后置双摄机型，在拍摄方面还是值得肯定，搭配了后置（1200W+500W）的双摄像头，成像效果比较出色，而为了让双摄效果更加出色，其增加了一项功能-8倍变焦功能，让拍摄更加符合双摄的要求，在新推出的Funtouch3.0版本系统中，进行了更新。',0,0,0,6,0,0,'http://toutiao.com/group/6402770792984461570/','http://toutiao.com/group/6402770792984461570/?iid=0&app=news_article',1490762100,1490771667,0,0,'Xplay6,vivo'),(630,6402803256762188033,'靓丽MM们首选的vivo手机壳，手感舒适还时髦，回头率超高','数码极客','',0,0,0,6,0,0,'https://temai.snssdk.com/article/feed/index?id=2180365&subscribe=5571749564&source_type=6&content_type=2&create_user_id=951&classify=7&adid=__AID__','http://toutiao.com/group/6402803256762188033/?iid=0&app=news_article',1490769540,1490771667,0,0,'手机壳,360度全包,vivox7,步步高,电镀工艺'),(631,6402775363268706562,'潘九堂爆料：世界前5大手机品牌 有3家在东莞','缤锋评论','2016年，手机江湖风云激荡。华为高歌猛进，OPPO和vivo异军突起，苹果和小米跌落神坛，三星手机令人揪心。经过1年时间，整个手机产业的大格局，已经有了根本性的变化。近日，电子行业分析师潘九堂爆料，全球前五大手机品牌，有三家在东莞，东莞威武，并在发文后配了3个竖起大拇指的赞。',0,0,0,6,0,0,'http://toutiao.com/group/6402775363268706562/','http://toutiao.com/group/6402775363268706562/?iid=0&app=news_article',1490763180,1490771667,0,0,'在东莞,华为手机,步步高,OPPO,电子行业'),(632,6402564304969892098,'华为P10跟vivo X9plus应该怎么选？','胖胖玩机','你说的是vivo X9Plus吧，vivo没有r9s Plus。至于vivo X9Plus和华为P10，这两个品牌都是目前国产热销手机，各有特色吧，有优势也有劣势。华为P10在性能上搭载麒麟960处理器，和华为Mate9以及荣耀V9配置一样，价格却相差很大，选择让人尴尬。',0,0,0,6,0,0,'http://toutiao.com/group/6402564304969892098/','http://toutiao.com/group/6402564304969892098/?iid=0&app=news_article',1490714220,1490771667,0,0,'Mate9,HiFi,vivo X9Plus,华为P10,摄像头'),(633,6399079776036045058,'vivo在这个地方栽了跟头 但与华为OPPO的拉锯战依旧惨烈','运营商世界网','运营商世界网 洪吉开/文近日，手机线下零售大鳄迪信通2月份全渠道销售数据出炉，华为、OPPO、vivo不出意外地包揽前三，但是却有一个数据有些不合氛围，显得格外刺眼。',0,0,0,6,0,0,'http://toutiao.com/group/6399079776036045058/','http://toutiao.com/group/6399079776036045058/?iid=0&app=news_article',1489903080,1490771667,0,0,'运营商,OPPO,行政单位,行政区域,迪信通'),(634,6402594407194821122,'ViVo，我就是没事玩玩，哈哈','你看看呗','',0,0,0,6,0,0,'http://toutiao.com/group/6402594407194821122/','http://toutiao.com/group/6402594407194821122/?iid=0&app=news_article',1490720160,1490771667,0,0,''),(635,6402774514551226626,'许多人买它因为啥？不仅仅是曲面还有双摄','数码折腾爱好者','Xplay6作为vivo首款后置双摄机型，在拍摄方面还是值得肯定，搭配了后置（1200W+500W）的双摄像头，成像效果比较出色，而为了让双摄效果更加出色，其增加了一项功能-8倍变焦功能，让拍摄更加符合双摄的要求，在新推出的Funtouch3.0版本系统中，进行了更新。',0,0,0,6,0,0,'http://toutiao.com/group/6402774514551226626/','http://toutiao.com/group/6402774514551226626/?iid=0&app=news_article',1490762100,1490771667,0,0,'Xplay6,vivo'),(636,6402747222727868673,'二月份线上市场，魅族手机超越了苹果！三星却沦为“炮灰”！','APP皮皮爱应用','近年来，国产手机市场竞争日趋“白热化”，手机厂商为了保住市场份额，也是不断推出新机。那么，在上个月国内手机市场的“战况”如何呢？今天我就带大家来看看！近日，某网友在微博上分享了一组2月份的国内手机市场数据。',0,0,0,6,0,0,'http://toutiao.com/group/6402747222727868673/','http://toutiao.com/group/6402747222727868673/?iid=0&app=news_article',1490756400,1490771667,0,0,'魅族手机,三星手机,iPhone,VIVO,OPPO'),(637,6402558505316188418,'为什么小米卖不过OPPO、vivo？','好数码','在智能手机刚兴起的时候，普遍价格都比较贵，小米率先开启了性价比优势，随后演变成了价格战，所谓一分钱一分货，价格低要高配，很显然在工艺技术，拍照等就会有所忽略，一开始小米手机热度确实很高，随着消费者的使用，发现小米手机的体验感并不好，发热严重，品质差，使用长时间卡顿，电池不耐用等一',0,0,0,6,0,0,'http://toutiao.com/group/6402558505316188418/','http://toutiao.com/group/6402558505316188418/?iid=0&app=news_article',1490712660,1490771667,0,0,'智能手机,HiFi,品牌机,小米手机,OPPO'),(638,6402748894341497345,'千元中端机这几款手机成最大黑马','神猴数码','预算一千多块，确实就目前手机市场来说有很多的选择，就综合表现来说，个人比较推荐vivo，拍照、音效以及颜值上都得到不少用户的肯定。就一千多块的预算，不妨看看vivo Y67，最近挺火热的一款机型。',0,0,0,6,0,0,'http://toutiao.com/group/6402748894341497345/','http://toutiao.com/group/6402748894341497345/?iid=0&app=news_article',1490756100,1490771667,0,0,'vivo Y67,柔光灯,自动识别,前置摄像头,Moonlight'),(639,6402529475485303042,'Vivo Xplay6磨砂黑正式发布了，超爱','嘈嘈科技','Vivo Xplay6磨砂黑正式发布了，超爱Vivo正式推出了Xplay6的新配色“磨砂黑”，这也是该机继玫瑰金、香槟金之后的第三种款式。vivo还特意请来了维密超模奚梦瑶助阵，第一个现场试用。',0,0,0,6,0,0,'http://toutiao.com/group/6402529475485303042/','http://toutiao.com/group/6402529475485303042/?iid=0&app=news_article',1490705880,1490771667,0,0,'奚梦瑶,Xplay6,魅族,存储卡,Vivo'),(640,6402603590594068738,'oppo r9s和vivo x9的处理器哪个好？','头条问答','',0,0,0,6,0,0,'http://toutiao.com/item/6402603590594068738/','http://toutiao.com/group/6402603590594068738/?iid=0&app=news_article',1490722320,1490771667,0,0,''),(641,6391025168417014017,'最强拍照国产机：vivo Xplay6','互八','拍照功能早已是各大手机厂商的必争之地，一旦有新技术被利用起来，厂商们便会马不停蹄地进行宣传，比如华为的徕卡双摄。不过要论谁是最强拍照国产机，还真不是华为，而是OV，这两家进入智能手机领域后便以拍照为卖点，如今技术愈发纯熟。',0,0,0,6,0,0,'http://toutiao.com/group/6391025168417014017/','http://toutiao.com/group/6391025168417014017/?iid=0&app=news_article',1488027360,1490771667,0,0,'曲面屏,Xplay6,Funtouch,摄像头,夜视仪'),(642,6402699568751837442,'VIVO手机朋友圈保存小视频怎么删除？','头条问答','我在微信朋友圈保存后的小视频怎么删除掉',0,0,0,6,0,0,'http://toutiao.com/item/6402699568751837442/','http://toutiao.com/group/6402699568751837442/?iid=0&app=news_article',1490757900,1490771667,0,0,'vivo手机,朋友圈'),(643,6402580588095602945,'vivo手机声音变小怎么办？','头条问答','我用的是vivox5max以前声音挺大的，现在都快听不见了，愁人',0,0,0,6,0,0,'http://toutiao.com/item/6402580588095602945/','http://toutiao.com/group/6402580588095602945/?iid=0&app=news_article',1490720520,1490771667,0,0,''),(644,6402536991053627650,'印度市场中国手机占据半壁江山，vivo小米OPPO当地称王！','Po数码','2017年，全球品牌总价值达到创纪录水平，总价值增长6%达到了5,571亿美元；其中科技、银行和电信运营商在品牌价值贡献中处于领先位置；当前在中国众多品牌中，腾讯仍是中国最具价值品牌，其品牌价值增长29%至1060亿美元。',0,0,0,6,0,0,'http://toutiao.com/group/6402536991053627650/','http://toutiao.com/group/6402536991053627650/?iid=0&app=news_article',1490707560,1490771667,0,0,'印度市场,OPPO,国产手机,BrandZ,印度'),(645,6402579920039444993,'你的OPPO手机，这四个功能默认不开，开启后手机体验更爽！','简单的发呆','去年是国内手机线下渠道爆发增长的一年，而以OPPO、vivo为代表的主攻线下渠道的厂商成为最大的受益者。据权威机构统计，去年全球五大出货量的手机厂商中，国内手机厂商占据三席，华为位列第三、OPPO第四、 vivo第五。',0,0,0,6,0,0,'','http://toutiao.com/group/6402579920039444993/?iid=0&app=news_article',1490716800,1490771667,0,0,'手机厂商,oppo手机,翻转静音,手机配件,OPPO手机'),(646,6402511628269355265,'嫌弃OPPO、vivo手机的界面太丑？这个软件绝对能让你满意','IT168手机频道','对于喜欢搞机的朋友来说，一成不变的手机桌面就是阻止自己发挥想象力的最大敌人。想必会有不少安卓用户会像我一样必定时的更换桌面启动器，借此来缓解固定化桌面所带来的审美疲劳。但由于目前国产手机厂商对于软件系统的优化越来越完善，导致曾经百花齐放的桌面启动器软件如今变得七零八落。',0,0,0,6,0,0,'http://toutiao.com/group/6402511628269355265/','http://toutiao.com/group/6402511628269355265/?iid=0&app=news_article',1490701920,1490771667,0,0,'桌面启动器,百看不厌,负一屏,桌面,毛玻璃'),(647,6402603239174308098,'oppo、vivo、美图哪个拍照好看？','头条问答','',0,0,0,6,0,0,'http://toutiao.com/item/6402603239174308098/','http://toutiao.com/group/6402603239174308098/?iid=0&app=news_article',1490722320,1490771667,0,0,''),(648,6402713370759708929,'无色彩不科技 手机新配色花红柳绿','互八','俗话说得好科技以换壳为本，这不在新的一年里，以华为、苹果、OPPO、vivo为代表的厂商在推出新手机的同时也推出了草木绿、中国红、磨砂黑等全新配色。新手机搭配新配色，走到哪里都能与众不同，别具一格。华为P10草木绿作为一款主打设计的手机，机身颜色是P10的一大亮点。',0,0,0,6,0,0,'','http://toutiao.com/group/6402713370759708929/?iid=0&app=news_article',1490748780,1490771667,0,0,'Xplay6,iPhone 7,华为,OPPO,P10'),(649,6402600829924147457,'如何评价oppo vivo的低俗营销？','头条问答','图说明一切',0,0,0,6,0,0,'http://toutiao.com/item/6402600829924147457/','http://toutiao.com/group/6402600829924147457/?iid=0&app=news_article',1490724240,1490771667,0,0,''),(650,6402756083996328194,'点亮你的生活 smart light柔光智能壳轻体验','数码简影','随着智能手机市场的不断发展，用户对于“换机”的兴趣已经不高，更多人开始热衷于手机后壳，市面上的手机壳层出不穷，看似种类繁多，其实只是换了不同的图案，并无太多新意。',0,0,0,6,0,0,'http://toutiao.com/group/6402756083996328194/','http://toutiao.com/group/6402756083996328194/?iid=0&app=news_article',1490758440,1490771667,0,0,'手机壳,APP,smart light,封光开关,闪光灯'),(651,6402604008556462337,'oppo和vivo哪个好用？','头条问答','',0,0,0,6,0,0,'http://toutiao.com/item/6402604008556462337/','http://toutiao.com/group/6402604008556462337/?iid=0&app=news_article',1490722440,1490771667,0,0,''),(65