107396352934146/','http://toutiao.com/group/6403107396352934146/?iid=0&app=news_article',1490840280,1491149582,0,0,'涨价,促销活动,愚人节,vivo X9 Plus,运营商世界商城'),(703,6399142745600098562,'vivo的手机用久了会卡吗？','神猴数码','说实在话，你说安卓手机不卡那是没有道理的，即便是最新出品的华为P10、荣耀V9手机都只能坚称自己500天不卡罢了，换句话说，任何安卓手机使用时间长了都会出现很卡的现象。话又说回来，对于vivo年度旗舰手机来说，卡与不卡只能说这是相对而言的。',0,0,0,6,0,0,'http://toutiao.com/group/6399142745600098562/','http://toutiao.com/group/6399142745600098562/?iid=0&app=news_article',1491091860,1491149582,0,0,'性价比,Xplay5,Xplay6,骁龙820,iPhone'),(704,6404415273948070146,'停下来看一看，手机促销标语读读也能让你乐上一整天','extraordinarily','东街走，西街走，看看你有没有，如果还没有，该出手时就出手，机会不是天天有。大街小巷走个遍，都没这条街上的店面品种全。停下来看一看，手机促销标语读读也能让你乐上一整天。',0,0,0,6,0,0,'http://toutiao.com/group/6404415273948070146/','http://toutiao.com/group/6404415273948070146/?iid=0&app=news_article',1491145200,1491149582,0,0,'华为,山地车,OPPO,VIVO,官网价'),(705,6403970630454214914,'Vivo X9 使用技巧，总有你还不知道的，超使用！','溜溜科技','依靠着深耕多年的线下市场，OPPO和vivo这两年到了收获的季节。北京市场调研机构赛诺给出的数据显示，2017年1月份，OPPO、vivo在中国持续强势，国内出货量分别为835万部、728万部，分别占据了17.1％和14.9％的市场份额。',0,0,0,6,0,0,'http://toutiao.com/group/6403970630454214914/','http://toutiao.com/group/6403970630454214914/?iid=0&app=news_article',1491041280,1491149582,0,0,'vivo,多任务,OPPO,Home键,Vivo'),(706,6404360226787737858,'什么样的千元机更值得入手，这款手机高颜值、功能强更能打动你','数码大时代','千元机绝对是市场上的主流，要不然当年雷军也不会把小米手机定在1999元，即使过了这么多年，仍然还坚守在1999元的价位，其它厂商也是如此。旗舰手机只能代表厂家的研发实力，千元机才是销量主流。市场上的千元机实在太多太多，眼花缭乱，如果不了解手机根本无从下手。',0,0,0,6,0,0,'','http://toutiao.com/group/6404360226787737858/?iid=0&app=news_article',1491132600,1491149582,0,0,'Xplay,千元机,Y67,旗舰手机,VIVO手机'),(707,6404190823386186242,'流畅不卡顿，vivo凭借的是啥本事？','神猴数码','说实在话，你说安卓手机不卡那是没有道理的，即便是最新出品的华为P10、荣耀V9手机都只能坚称自己500天不卡罢了，换句话说，任何安卓手机使用时间长了都会出现很卡的现象。话又说回来，对于vivo年度旗舰手机来说，卡与不卡只能说这是相对而言的。',0,0,0,6,0,0,'http://toutiao.com/group/6404190823386186242/','http://toutiao.com/group/6404190823386186242/?iid=0&app=news_article',1491091860,1491149582,0,0,'Xplay6,骁龙820,iPhone,性价比,Xplay5'),(708,6404358224987816450,'vivo','用户33292396','',0,0,0,6,0,0,'http://toutiao.com/group/6404358224987816450/','http://toutiao.com/group/6404358224987816450/?iid=0&app=news_article',1491130800,1491149582,0,0,''),(709,6404305995250647298,'用来和iPhone 6s对比的旗舰机，降价2000多清库存','数码大教主','华为作为中国通讯行业大佬，虽然这两年不断受到段永平旗下的oppo和vivo的挑战。但在手机行业依然具有举足轻重的地位。今天要说的是这款Mate S臻享版售价为4199元，发布之时就用来和iPhone 6s做比较的旗舰机，如今某猫的售价不到2000，跳水幅度让人泪奔。',0,0,0,6,0,0,'http://toutiao.com/group/6404305995250647298/','http://toutiao.com/group/6404305995250647298/?iid=0&app=news_article',1491119640,1491149582,0,0,'EMUI,段永平,iPhone,华为Mate,华为手机'),(710,6404096874639474945,'VIVO手机开启这几个功能，让音质提升太多，非常好用！','简单的发呆','作为目前vivo旗舰机型的代表作，vivo Xplay6一直拥有着不俗的人气，即使开售已有一段时间，但Xplay6的热度丝毫不减。为了让更多用户用上这款出色的机型，近日vivo推出了Xplay6的新版本——vivo Xplay6磨砂黑版本。',0,0,0,6,0,0,'','http://toutiao.com/group/6404096874639474945/?iid=0&app=news_article',1491071700,1491149582,0,0,'Xplay6,QQ音乐,华为手机,Hi-Fi,手机壳'),(711,6404430310763168001,'非诚勿扰停播了，为什么今年来OPPO/VIVO不再冠名它？','手机老司机','今天听到了一个消息，非诚勿扰停播了。即使作为多年前的非诚勿扰忠实粉丝，近几年也早早放弃了这款综艺，甚至去看《中国式相亲》，都不会有一点点兴趣看《非诚勿扰》。',0,0,0,6,0,0,'http://toutiao.com/group/6404430310763168001/','http://toutiao.com/group/6404430310763168001/?iid=0&app=news_article',1491148680,1491149582,0,0,'湖南卫视,步步高,中国式相亲,非诚勿扰,观众群,江苏卫视'),(712,6404341795198599426,'为什么那么多人不喜欢ov的手机呢？','头条问答','我自己的手机就是vivo x6s的，买好长时间了从来没有卡过。也从没有过什么问题。可能唯一不好的就是系统升级慢吧。但我感觉不是不错的，为什么有那么多人喷vivo手机呢？',0,0,0,6,0,0,'http://toutiao.com/item/6404341795198599426/','http://toutiao.com/group/6404341795198599426/?iid=0&app=news_article',1491127560,1491149582,0,0,'vivo手机,vivo'),(713,6404092753898602754,'如果你的vivo手机，这3个隐藏的功能没使用，怪可惜的！','简单的发呆','作为目前vivo旗舰机型的代表作，vivo Xplay6一直拥有着不俗的人气，即使开售已有一段时间，但Xplay6的热度丝毫不减。为了让更多用户用上这款出色的机型，近日vivo推出了Xplay6的新版本——vivo Xplay6磨砂黑版本。',0,0,0,6,0,0,'','http://toutiao.com/group/6404092753898602754/?iid=0&app=news_article',1491070620,1491149582,0,0,'手机壳,操作步骤,vivo Xplay6,网络权限,华为手机'),(714,6404094270545969409,'vivo Xplay6磨砂黑版 智能手机 图集 [Soomal]','数码多','由于Xplay6市场表现强劲，好得出乎厂商意料，vivo特地推出了磨砂黑外壳版本以满足消费者的需求，相对于金色、白色等中性的色彩，黑色版更符合男性的审美气质，而硬件配置保持一致。',0,0,0,6,0,0,'http://www.soomal.com/doc/10100007193.htm','http://toutiao.com/group/6404094270545969409/?iid=0&app=news_article',1491070980,1491149582,0,0,'手机-,智能手机vivo Xplay6,磨砂黑,Pixel,vivo Xplay6'),(715,6404030508178948354,'vivo和oppo手机卖的好但赚的多吗？','IT手机资讯','做生意，哪家不赚钱的，不赚钱的生意会有人做么？尤其是智能手机，前期肯定是要亏钱的，做研发，铺渠道，做宣传等等，OPPO和vivo现在起来了，销量也很多，但它的开销也是很大的，像邀请明星代言，赞助综艺节目，当然付出都会有回报了，如今OPPO和vivo已经成为了热销手机。',0,0,0,6,0,0,'http://toutiao.com/group/6404030508178948354/','http://toutiao.com/group/6404030508178948354/?iid=0&app=news_article',1491055440,1491149582,0,0,'智能手机,创新技术,苹果手机,HiFi,OPPO'),(716,6404356275605340417,'vivo厂里工程师一年大约多少工资？','头条问答','',0,0,0,6,0,0,'http://toutiao.com/item/6404356275605340417/','http://toutiao.com/group/6404356275605340417/?iid=0&app=news_article',1491130440,1491149582,0,0,''),(717,6404392976974184705,'oppo r9s 双摄到底有多厉害？看过了才知道！','数码天地','随着手机厂家越来越多，大多数的手机制造商都加入双摄大军。比如vivo，努比亚，苹果，小米和oppo。早先的手机镜头仅限于记录画面，而现在的手机已经能胜任更复杂的拍摄需求了。相信各位对手机摄影有所关注的用户都知道，“双摄像头”是最近非常热门的技术名词，那么双摄像头究竟有什么用？',0,0,0,6,0,0,'','http://toutiao.com/group/6404392976974184705/?iid=0&app=news_article',1491139920,1491149582,0,0,'iPhone 7,双摄像头,OPPO,光电二极管,分辨率'),(718,6399656463895707905,'999元！vivo入门新机Y53曝光！','王朝科技','vivo自从推出柔光双摄手机 X9 以来，品牌热度一直持续上升。网友一直期待 vivo 更新下一款新机——vivo X11，不过可能要让网友失望了，最近有网友曝光vivo一款新机，不是X系列，而是Y系列。',0,0,0,6,0,0,'http://toutiao.com/group/6399656463895707905/','http://toutiao.com/group/6399656463895707905/?iid=0&app=news_article',1491033360,1491149582,0,0,'X11,Android,标准版,vivo,操作系统'),(719,6404344469005091073,'17年最走心的男女款vivo x7专属手机壳，一眼相中第4款','数码极客','',0,0,0,6,0,0,'https://temai.snssdk.com/article/feed/index?id=2220701&subscribe=5571749564&source_type=6&content_type=2&create_user_id=951&classify=7&adid=__AID__','http://toutiao.com/group/6404344469005091073/?iid=0&app=news_article',1491128820,1491149582,0,0,'vivo x7,手机壳,vivox7,步步高,电镀工艺'),(720,6404373869294354689,'小米之家单店年营业额过亿，远超华为OPPO，你知道为什么吗？','互联网我知道','过去的2016年，小米手机的出货量跌出前五，被线下布局完善的OPPO和vivo超越。其中OPPO销量更是暴涨109%，达到9500万部，成为手机厂商中最大的黑马。此情此景，让很多人开始唱衰小米了，然而小米的另一面他们没有看到。',0,0,0,6,0,0,'http://toutiao.com/group/6404373869294354689/','http://toutiao.com/group/6404373869294354689/?iid=0&app=news_article',1491135600,1491149582,0,0,'小米手机,OPPO,净水器,线下渠道,营业额'),(721,6403989598640488706,'网友称小米、OPPO、vivo只是二流品牌，你认同吗？','手机中毒者','如果你仔细数一下当下智能手机，你想入手的品牌可能不会超过5个。看似百花齐放，其实大家心目中无非就是苹果、三星、华为、小米、OPPO、vivo，外加一加、360等品牌了。而在这些品牌之中，一线品牌也就苹果和三星了，华为目前上升的挺快但与苹果和三星还是有差距的。',0,0,0,6,0,0,'http://toutiao.com/group/6403989598640488706/','http://toutiao.com/group/6403989598640488706/?iid=0&app=news_article',1491083520,1491149582,0,0,'智能手机,品牌认知度,小米,诺基亚,OPPO'),(722,6404155029955019265,'无论小米还是OPPO、vivo，当下必须做同一件事情','手机中毒者','如果你仔细数一下当下智能手机，你想入手的品牌可能不会超过5个。看似百花齐放，其实大家心目中无非就是苹果、三星、华为、小米、OPPO、vivo，外加一加、360等品牌了。而在这些品牌之中，一线品牌也就苹果和三星了，华为目前上升的挺快但与苹果和三星还是有差距的。',0,0,0,6,0,0,'http://toutiao.com/group/6404155029955019265/','http://toutiao.com/group/6404155029955019265/?iid=0&app=news_article',1491083520,1491149582,0,0,'智能手机,品牌认知度,小米,诺基亚,OPPO'),(723,6404262209173586433,'预算3000元，六大品牌当家花旦手机','数码极客','当今社会智能手机市场竞争非常的激烈，手机的品牌众多，手机的型号更是让人眼花缭乱，各大手机品牌也不断升级技术，想要选择一款中意的手机，着实让人有点儿困难，今天小编就推荐六款三千元之内的手机，它们的内存，处理器以及像素都非常的高端，美观与实用兼具，让你体验智能生活，带你体验一个新的高',0,0,0,6,0,0,'https://temai.snssdk.com/article/feed/index?id=2218449&subscribe=5571749564&source_type=6&content_type=1&create_user_id=2340&classify=7&adid=__AID__','http://toutiao.com/group/6404262209173586433/?iid=0&app=news_article',1491108480,1491149582,0,0,'双卡双待,运行内存,摄像头,OPPO,电池容量'),(724,6404297946486194433,'S8真机曝光：雪耻note7或成新一代android机皇','奇葩说猛料','自去年note7爆炸事件至今，三星手机似乎沉寂于国内手机市场。虽有C系列产品陆续发布博人眼球，但相较于vivo，oppo等众多新机型的狂轰滥炸，其动作显然对于市场不痛不痒。现在看来，三星大有厚积薄发之势。',0,0,0,6,0,0,'http://toutiao.com/group/6404297946486194433/','http://toutiao.com/group/6404297946486194433/?iid=0&app=news_article',1491117780,1491149582,0,0,'MIX,双曲面,S7,毫安时,note7'),(725,6403859522700984578,'OPPOR9S跟vivoX9哪个适合你呢？','贾老先森','OPPO R9s和vivo X9这两部手机在性能上都是一样的，并没有什么区别，不过体验感还是有一定差异的，因为OPPO主打时尚女性市场，而vivo X9则是主打商务，所以功能点不相同。',0,0,0,6,0,0,'http://toutiao.com/group/6403859522700984578/','http://t