OPPO'),(752,6403970123649253634,'抢不过生意，vivo老板气疯了，跟隔壁怼起来了！','德德麦','事情的起因还要从下面这幅图说起 ↓↓↓vivo老板疯了看到vivo老板说什么了吗“隔壁送什么 我也送什么”我理解老板门可罗雀的凄凉但是你确定隔壁送什么你就送什么吗？',0,0,0,6,0,0,'http://toutiao.com/group/6403970123649253634/','http://toutiao.com/group/6403970123649253634/?iid=0&app=news_article',1491041160,1491149582,0,0,'苏泊尔,泸州老窖,贵州茅台,吹风机,电饭煲'),(753,6404289411009216769,'为什么国人如此热衷苹果手机？','头条问答','行走在大街上有10部电话里面六部就是苹果。其余的国产就是小米，华为，VIVO,oppo，为什么国人如此热衷苹果手机。',0,0,0,6,1,0,'http://toutiao.com/item/6404289411009216769/','http://toutiao.com/group/6404289411009216769/?iid=0&app=news_article',1491115260,1491149582,1494091749,0,'苹果手机,VIVO'),(754,6404281185400570114,'“小米≠小米手机”不做手机也不会死？押宝物联网成就小米百货！','数码人科技','如今不熟悉小米的人，一说到小米可能就会联想到小米手机，按照普罗大宗的思想，终究要有一天不再做手机了。会不会死呢？那就一起来看一下，小米不再做手机的时候，会不会死？',0,0,0,6,2,0,'http://toutiao.com/group/6404281185400570114/','http://toutiao.com/group/6404281185400570114/?iid=0&app=news_article',1491113940,1491149582,1494091746,0,'空气净化器,米家,小米手机,OPPO,物联网'),(755,6403063090565464321,'vivo XE1000图赏：精雕细琢','海峡网','[海峡都市报-海峡网]vivo XE1000 的发布已经是一年以前的事情了，一款头戴式耳机在发布了这么长时间之后才上市确实不多见。但我们当然也可以认为，vivo XE1000 在这段时间里更加完美了，不过到底如何就还需要用声音来说话了。',0,0,0,6,1,0,'http://m.hxnews.com/news/itkj/kjsm/201703/30/jrtt_1187150.shtml','http://toutiao.com/group/6403063090565464321/?iid=0&app=news_article',1490831580,1491149591,1494091743,0,'Tesla,vivo XE1000,头戴式耳机,vivo,手机市场');
